import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Paper from '@material-ui/core/Paper';
import { Container, Grid } from '@material-ui/core';

const useStyles = makeStyles({

    root: {
        maxWidth: "90%",
        padding: '2%'
    },


    Title: {
        textAlign: 'center',
        marginTop: '2%'

    },

    ptin: {
        float: 'right',
        // marginBotom:'25
        clear: "both",


    },
    btn: {
        justifyContent: 'center'
    },
    btnRight: {
        float: "right"
    },
    leftcontent:{
        float:'left',



    },
    rigthconter:{
        float:"right"
    },
    centerdiv:{
        margin: "10px 90px 0px 90px"
    }

});


export default function CitizenDetail({ userData }) {
    const classes = useStyles();
    console.log(userData, "propaaaa")
    return (
        <Container  >

            <Typography className={classes.Title} variant="h4">Property Details</Typography>
            <Grid container spacing={12} justify="center">

                <Grid item xs={12} md={8} >
                    <Card className={classes.root}>
                        <CardActionArea style={{padding:'0 10px 0 '}}>
                            <CardContent className={classes.centerdiv}>
                                <Typography className={classes.ptin} gutterBottom variant="h5" component="h2">
                                    {userData.PTIN}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Financial_Year}
                                </Typography>
                            </CardContent>

                            <CardContent className={classes.leftcontent}>
                                <Typography gutterBottom variant="h5" component="h2">
                                    Owner Name 
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    House No. 
                                </Typography>
                                <Typography  gutterBottom variant="h5" component="h2">
                                    Locality
                                </Typography>
                                <Typography  gutterBottom variant="h5" component="h2">
                                    Property Type 
                                </Typography>
                                <Typography  gutterBottom variant="h5" component="h2">
                                    Last Payment Date 
                                </Typography>
                                <Typography  gutterBottom variant="h5" component="h2">
                                    Total Paid Amount
                                </Typography>
                            </CardContent>

                            <CardContent className={classes.rigthconter}>

                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Owner_Name}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.House_No}, {userData.Zone}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Locality}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Property_type}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Last_Payment_Date}
                                </Typography>
                                <Typography gutterBottom variant="h5" component="h2">
                                    {userData.Total_Paid_Amount}
                                </Typography>
                            </CardContent>
                        </CardActionArea>
                        <CardActions className={classes.btn}>
                            <Button variant="contained" color="primary" >
                                Send Request
                    </Button>
                            <Button variant="contained" color="secondary" className={classes.btnRight}>
                                Edit Detail
                    </Button>
                        </CardActions>
                    </Card>
                </Grid>


            </Grid>
        </Container>

    );
}














